import { useDispatch } from 'react-redux'
import { deleteNotes } from '../features/notes/notesSlice'

function NotesItem({ notes }) {
  const dispatch = useDispatch()

  return (
    <div className='notes'>
      <div>{new Date(notes.createdAt).toLocaleString('en-US')}</div>
      <h2>{notes.text}</h2>
      <button onClick={() => dispatch(deleteNotes(notes._id))} className='close'>
        X
      </button>
    </div>
  )
}

export default NotesItem
